// App.js

import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import { AppBar, Toolbar, Button, Container, Typography } from "@mui/material";
import Home from "./Pages/Home";
import One from "./Pages/One";
import Two from "./Pages/Two";
import Three from "./Pages/Three";
import Four from "./Pages/Four";

import "./app.css";

const App = () => {
  return (
    <Router>
      <div id="appContainer">
        <AppBar position="static">
          <Toolbar>
            <Link to="/" className="navLink">
              <Typography variant="h6">Home</Typography>
            </Link>
            <Link to="/one" className="navLink">
              <Typography variant="h6">One</Typography>
            </Link>
            <Link to="/two" className="navLink">
              <Typography variant="h6">Two</Typography>
            </Link>
            <Link to="/three" className="navLink">
              <Typography variant="h6">Three</Typography>
            </Link>
            <Link to="/four" className="navLink">
              <Typography variant="h6">Four</Typography>
            </Link>
          </Toolbar>
        </AppBar>

        <Container id="content">
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/one" element={<One />} />
            <Route path="/two" element={<Two />} />
            <Route path="/three" element={<Three />} />
            <Route path="/four" element={<Four />} />
          </Routes>
        </Container>
      </div>
    </Router>
  );
};

export default App;
